import React from 'react';
import coverImg from '../../assests/cover.jpg'

const Headers = (props) => {
    return (
        <React.Fragment>
            <header>
                <h1>React Meals</h1>
                <button>Cart</button>
            </header>
            <div>
                <img src={coverImg} alt=""/>
            </div>
        </React.Fragment>
    );
}

export default Headers;
